activated = false

options = {
	{"ak vanilla", 30.9, "ak"},
	{"ak holo", 37.15, "ak"},
	{"mp5 vanilla", 31, "mp5"},
	{"mp5 holo", 37, "mp5"},
	{"smg vanilla", 25.5, "smg"},
	{"thompson vanilla", 25.5, "thompson"},
	{"lr vanilla", 30.9, "lr"},
	{"lr holo", 37.15, "lr"},
	{"lr 8x", 118, "lr"},
	{"m2 vanilla", 15, "m2"},
	{"m2 holo", 18.5, "m2"},
	{"m2 8x", 59, "m2"},
}

selected = 1

function OnEvent(event, arg)

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 1 and activated) then

		option = options[selected]
        values = weapons[option[3]]
        px_factor = option[2]

        start_ms = GetRunningTime()

        -- move tracker
		moved_raw_x = 0
    	moved_raw_y = 0

    	-- pixel uebertrag
    	x_px_pool = 0
    	y_px_pool = 0
    	repeat
    		
    		passed_ms = GetRunningTime() - start_ms

    		position = values[passed_ms]
    		if(position ~= nil) then
    			-- how much we should move raw
	    		now_move_y = position[2] - moved_raw_y

	    		-- calculate pixel to move
	    		move_y_px = (now_move_y * px_factor)

	    		-- add whats left in the pool
	    		move_y_px = move_y_px + y_px_pool
	    		
	    		-- floor it 
	    		move_y_px_floored = abs_floor(move_y_px)

	    		-- get the non whole pixel we didnt move
				y_px_pool = move_y_px - move_y_px_floored

				-- update the total that we moved
				moved_raw_y = moved_raw_y + now_move_y


				-- same for x
	    		now_move_x = position[1] - moved_raw_x
	    		moved_raw_x = moved_raw_x + now_move_x
	    		move_x_px = (now_move_x * px_factor)

	    		--OutputLogMessage("move_x_px: %f, x_px_pool: %f\n", move_x_px, x_px_pool)
	    		move_x_px = move_x_px + x_px_pool
	    		move_x_px_floored = abs_floor(move_x_px)
				x_px_pool = move_x_px - move_x_px_floored
				--OutputLogMessage("move_x_px_floored: %f, x_px_pool: %f\n\n", move_x_px_floored, x_px_pool)

	    		MoveMouseRelative(-move_x_px_floored, -move_y_px_floored)
    		end
            Sleep(1)
        until not IsMouseButtonPressed(1)
    end

    if (event == "PROFILE_ACTIVATED") then
        EnablePrimaryMouseButtonEvents(true)
    end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 5) then
        activated = not activated
        OutputLogMessage("Activated: %s - %s\n", tostring(activated), options[selected][1])
    end

    if (event == "MOUSE_BUTTON_PRESSED" and arg == 4) then
        if selected >= #options then
            selected = 1
        else
            selected = selected +1
        end
        OutputLogMessage("Selected: %s\n", options[selected][1])
    end 
end

function abs_floor(val)
	if val > 0 then
		return math.floor(val)
	else
		return math.ceil(val)
	end
end
